import './App.css';
import React from 'react';
import{BrowserRouter as Router,Link, Route} from 'react-router-dom'

function App() {
  return (
    <div className='App'>
      <Router>
        <Link to="/home">Home</Link>
        <Link to="/about">About US</Link>
        <Link to="/blog">Blog</Link>
        <Link to="/contact">Contact US</Link>
        <Route path="home"><Home /></Route>
        <Route path="about"><About /></Route>
        <Route path="blog"><Blog /></Route>
        <Route path="contact"><Contact /></Route>
    </Router>
    </div>
  );
}

function Home()
{
  return(
  <div>
    <h1>Home</h1>
    <p>This is Home Page of website</p>
  </div>
  )
}

function About()
{
  return(
  <div>
    <h1>About US</h1>
    <p>This is About US Page of website</p>
  </div>
  )
}

function Blog()
{
  return(
  <div>
    <h1>Blog</h1>
    <p>This is Blog Page of website</p>
  </div>
  )
}

function Contact()
{
  return(
  <div>
    <h1>Contact US</h1>
    <p>This is Contact US Page of website</p>
  </div>
  )
}
export default App;
